import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the price filter section to appear
    await page.waitForSelector('.price-filter', { timeout: 5000 });

    // Fill in min price
    await page.waitForSelector('#minPrice', { timeout: 5000 });
    await page.fill('#minPrice', '100');

    // Fill in max price
    await page.waitForSelector('#maxPrice', { timeout: 5000 });
    await page.fill('#maxPrice', '500');

    // Take screenshot after filling price range
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_filled_price_range.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_filled_price_range.png'));

    // Click the Apply button
    await page.waitForSelector('.apply-filter', { timeout: 5000 });
    await page.click('.apply-filter');

    // Wait for products grid/list to update (look for product cards)
    // We'll wait for at least one .product-card to be visible
    await page.waitForSelector('.product-card, .product-card-list', { timeout: 5000 });

    // Take screenshot after applying filter
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_apply.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_apply.png'));

    // Extract the visible product titles and prices after filter
    const products = await page.$$eval('.product-card, .product-card-list', nodes =>
      nodes.map(node => {
        const title = node.querySelector('.product-title')?.textContent?.trim() || '';
        const priceText = node.querySelector('.product-price')?.textContent || '';
        // Extract first price number from priceText
        const priceMatch = priceText.match(/\$([0-9,.]+)/);
        const price = priceMatch ? parseFloat(priceMatch[1].replace(/,/g, '')) : null;
        return { title, price };
      })
    );

    // Filter out products with price not in 100-500 range (for verification)
    const filteredProducts = products.filter(p => p.price !== null && p.price >= 100 && p.price <= 500);

    return {
      success: true,
      action: "Applied price range filter (100 to 500) and verified filtered products.",
      extractedData: {
        visibleProducts: products,
        filteredProducts
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
